const { POST_REGISTRATION_SUCCESS, POST_REGISTRATION_REQUEST, POST_REGISTRATION_FAILURE } = require("../Action/registration.action")

const initialState ={ };

export function registrationReducer(state = initialState,action){
    console.log(action,'action')
    switch(action.type){
        case POST_REGISTRATION_REQUEST:
        return {
            ...state,
           loading:true
        }
        case POST_REGISTRATION_SUCCESS:
            
        return{
            
            postUsers:action.payload,
            
        }
        case POST_REGISTRATION_FAILURE:
        return{
            loading:false,
            postUsers:'test',
            error:action.payload
        }

        default:return state
    }

}


export function get_my_donation_request(state = initialState, action) {
    switch (action.type) {
      case POST_REGISTRATION_REQUEST:
        return {
          getdonation: false,
        };
      case POST_REGISTRATION_SUCCESS:
        return {
          getdonation: action.data.data.data,
        };
      case POST_REGISTRATION_FAILURE:
        return {getdonation: false};
  
      default:
        return state
    }
  }
